// Color at pixel with coordinate (x, y)
// https://stackoverflow.com/questions/3528299/get-pixel-color-of-base64-png-using-javascript
function getColorAt(image, coordinate) {
  const canvas = document.createElement('canvas');
  const context = canvas.getContext('2d');
  context.drawImage(image, 0, 0);

  const imageData = context.getImageData(0, 0, image.width, image.height);

  // Now you can access pixel data from imageData.data.
  // It's a one-dimensional array of RGBA values.
  const [x, y] = coordinate;
  const index = (y * image.width + x) * 4;
  const [r,g,b,a] = imageData.data.slice(index, index + 4);
  const bgColor = `rgba(${r},${g},${b},${a})`;
  return bgColor;
}

function getImageBackground(image) {
  const topMid = [image.width/2, 1];
  const bgColor1 = getColorAt(image, topMid);

  const leftMid = [1, image.height/2];
  const bgColor2 = getColorAt(image, leftMid);
  if (bgColor1 !== bgColor2) {
    return;
  }
  return bgColor1;
}

function parsePlaid(plaidStr) {
  const src = `data:image/png;base64, ${plaidStr}`;
  const image = new Image();
  image.src = src;
  image.onload = function() {
    const img = document.createElement("img");
    img.src = src;
    const bgColor = getImageBackground(image);
    if (bgColor) {
      img.style.backgroundColor = bgColor;
    }

    const test = document.getElementById("test");
    test.appendChild(img);
  };
}

plaidStrs.forEach(str => parsePlaid(str))
